import { NavLink } from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <div>
      <header>
      </header>
      <body>
        <NavLink to='roomSettings'></NavLink>
        <div className='roomSettingsButton'>
          <button>Перейти в настройки переговорной комнаты</button>
        </div>
      </body>
    </div>
  );
}

export default App;
